  `state_of_origin` varchar(35) NOT NULL,
  `v_town_of_origin` varchar(50) NOT NULL,
  `highest_edu_qual` varchar(50) NOT NULL,
  `phone_number` varchar(11) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `f_state_of_origin` varchar(35) NOT NULL,
  `f_village_town` varchar(100) NOT NULL,
  `mothers_name` varchar(255) NOT NULL,
  `mothers_maiden_name` varchar(50) DEFAULT NULL,
  `m_state_of_origin` varchar(35) NOT NULL,
  `m_village_town` varchar(100) NOT NULL,
  `main_reason_for_request` varchar(255) NOT NULL,
  `identification` varchar(255) DEFAULT NULL,
  `identification_number` varchar(50) DEFAULT NULL,
  `nin` varchar(11) DEFAULT NULL,
  `court_name` varchar(50) NOT NULL,
  `age_declaration_date` date NOT NULL,
  `court_affid` char(36) DEFAULT NULL,
  `fathers_name` varchar(50) NOT NULL,
  `passport_photo` char(36) DEFAULT NULL,
  `lga_place_of_birth` int(10) UNSIGNED DEFAULT NULL,
  `lga` int(10) UNSIGNED DEFAULT NULL,
  `f_lga` int(10) UNSIGNED DEFAULT NULL,
  `m_lga` int(10) UNSIGNED DEFAULT NULL,
  `occupation` int(10) UNSIGNED DEFAULT NULL,
  `print_count` varchar(4) NOT NULL DEFAULT '0',
  `unique_id` char(36) DEFAULT NULL,
  `current_address` text NOT NULL,
  `add_place_of_work` text DEFAULT NULL,
  `court_address` text NOT NULL
